import React from "react";
import { NavLink } from "react-router-dom";
function Navbar() {
  return (
    <div className="navbar">
      <div className="leftLogo">
        <h1>Munsif Ali Misri</h1>
      </div>
    </div>
  );
}

export default Navbar;
